const ClassItem = (props) => {
  let classCode =
    props.item.college + " " + props.item.department + " " + props.item.number;
  return (
    <div className="bg-white p-5 shadow-xl border border-gray-200 flex-flex-col">
      <div className="flex">
        <span className="text-lg mr-3">{classCode}</span>
        <span className="text-md">{props.item.title}</span>
      </div>
      <div className="flex items-center"></div>
    </div>
  );
};

export default ClassItem;
